import React, { useEffect, useState } from "react";
import Card from "@mui/material/Card";
import Box from "@mui/material/Box";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import { Button, CardActionArea, CardActions } from "@mui/material";
import background from "./2.jpg";
import { useSelector, useDispatch } from "react-redux";
import { singleData } from "./dataReducer";
import Modal from "@mui/material/Modal";
import FormControl from "@mui/material/FormControl";
import Select from "@mui/material/Select";
import TextField from "@mui/material/TextField";

const style = {
  position: "absolute",
  top: "50%",
  left: "50%",
  transform: "translate(-50%, -50%)",
  width: 400,
  height: 200,
  bgcolor: "background.paper",
  border: "2px solid #000",
  boxShadow: 24,
  p: 4,
};

export default function ServiceUser(props) {
  const filterData = useSelector((state) => state.service.singleData);
  const dispatch = useDispatch();

  useEffect(() => {
    fetch("http://localhost:3001/users")
      .then((res) => res.json())
      .then((res) => {
        dispatch(singleData(res.users[res.users.length - 1]));
      });
  }, [dispatch]);
  const [first_name, setFirst_name] = useState(filterData.first_name);
  const [last_name, setLast_name] = useState(filterData.last_name);
  const [email, setEmail] = useState(filterData.email);
  const [role, setRole] = useState(filterData.role);
  const [gender, setGender] = useState(filterData.gender);
  const [address, setAddress] = useState(filterData.address);
  const [open, setOpen] = useState(false);
  const [rating, setRating] = useState(filterData.rating);
  const [mob_no, setMob_no] = useState(filterData.mob_no);
  const [price, setPrice] = useState(filterData.price);

  return (
    <div
      style={{
        backgroundImage: `url(${background})`,
        backgroundRepeat: "no-repeat",
        backgroundSize: "100% 100%",
        height: "100vh",
        width: "100%",
      }}
    >
      {" "}
      <Card
        sx={{
          maxWidth: 445,
          maxHeight: 400,
          paddingTop: 3,
          position: "relative",
          top: "20%",
          left: "38%",
          boxShadow: "gray 5px 9px  10px",
        }}
      >
        <CardActionArea>
          <CardContent>
            <Typography gutterBottom variant="h4" component="div">
              Name : {filterData.first_name} {filterData.last_name} <br />
            </Typography>
            <Typography variant="h6" color="text.secondary">
              {" "}
              Email : {filterData.email} <br />
              Mobile : {filterData.mob_no} <br />
              Price : {filterData.price} Rs/-
              <br />
              Service : {filterData.role}
              <br />
              Address : {filterData.address}
              <br />
              Rating : {filterData.rating}
              <br />
              Id : {filterData.id}
            </Typography>
          </CardContent>
        </CardActionArea>

        <CardActions>
          <Button size="large" color="primary" onClick={() => setOpen(true)}>
            Edit Details
          </Button>
          <Button onClick={() => props.history.push("/dashboard")}>
            Dashboard
          </Button>
        </CardActions>
      </Card>
      <Modal
        open={open}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box sx={style}>
          <form id="form" action="">
            <TextField
              id="outlined-required"
              required
              label="First Name"
              placeholder="Enter your first name here"
              value={first_name}
              onChange={(event) => setFirst_name(event.target.value)}
            />{" "}
            <br /> <br />
            <TextField
              id="outlined-required"
              required
              label="Last Name"
              placeholder="Enter your last name here"
              value={last_name}
              onChange={(event) => setLast_name(event.target.value)}
            />{" "}
            <br /> <br />
            <TextField
              id="outlined-required"
              required
              label="Email"
              placeholder="Enter your mail here"
              value={email}
              onChange={(event) => setEmail(event.target.value)}
            />
            <br /> <br />
            <TextField
              id="outlined-number"
              required
              autoComplete="username"
              label="Mobile Number"
              type="number"
              value={mob_no}
              onChange={(event) => setMob_no(event.target.value)}
            />{" "}
            <br /> <br />
            <TextField
              id="outlined-required"
              required
              label="Gender"
              placeholder="Enter your gender here"
              value={gender}
              onChange={(event) => setGender(event.target.value)}
            />{" "}
            <br /> <br />
            <TextField
              id="outlined-required"
              required
              label="address"
              placeholder="Enter your address here"
              value={address}
              onChange={(event) => setAddress(event.target.value)}
            />
            <br /> <br />
            <Box sx={{ maxWidth: 235, marginLeft: 101 }}>
              <FormControl fullWidth>
                <InputLabel id="demo-simple-select-label">Service</InputLabel>
                <Select
                  labelId="demo-simple-select-label"
                  id="demo-simple-select"
                  value={role}
                  label="role"
                  onChange={(event) => setRole(event.target.value)}
                  required
                  autoComplete="role"
                >
                  <MenuItem value={"plumber"}>plumber</MenuItem>
                  <MenuItem value={"washerman"}>washerman</MenuItem>
                  <MenuItem value={"electrician"}>electrician</MenuItem>
                </Select>
              </FormControl>
            </Box>{" "}
            <br />
            <TextField
              id="outlined-number"
              autoComplete="price"
              label="Price"
              type="number"
              required
              value={price}
              onChange={(event) => setPrice(event.target.value)}
            />{" "}
            <br /> <br />
            <TextField
              id="outlined-number"
              autoComplete="rating"
              label="rating"
              type="number"
              required
              value={rating}
              onChange={(event) => setRating(event.target.value)}
            />
            <br /> <br />
            <br /> <br />
            <Button
              onClick={handleClick}
              style={{ marginRight: "20px" }}
              variant="outlined"
            >
              Sign Up
            </Button>
            <Button
              onClick={() => props.history.push("/dashboard")}
              variant="outlined"
            >
              Dashboard
            </Button>
          </form>
        </Box>
      </Modal>
    </div>
  );
}
